// Map.jsx - Versión simplificada para depuración
import React from 'react';
import { GoogleMap, LoadScript } from '@react-google-maps/api';

const mapStyles = {
  height: "100%",
  width: "100%"
};

const defaultCenter = {
  lat: 19.404484068754225,
  lng: -99.08533448890726
};

const Map = () => {
  const apiKey = process.env.REACT_APP_GOOGLE_MAPS_API_KEY;
  
  console.log('API Key cargada:', apiKey ? 'SÍ' : 'NO');
  console.log('Valor:', apiKey);

  if (!apiKey) {
    return (
      <div style={{ 
        height: '100%', 
        display: 'flex', 
        alignItems: 'center', 
        justifyContent: 'center',
        background: '#f5f5f5',
        color: '#B32134',
        fontSize: '16px',
        fontWeight: '600',
        padding: '20px',
        textAlign: 'center'
      }}>
        ⚠️ Error: No se encontró la API Key de Google Maps
        <br/>
        <small style={{ fontSize: '14px', marginTop: '10px', display: 'block' }}>
          Verifica que el archivo .env existe y reinicia el servidor
        </small>
      </div>
    );
  }

  return (
    <LoadScript 
      googleMapsApiKey={apiKey}
      onLoad={() => console.log('Google Maps cargado correctamente')}
      onError={(error) => console.error('Error al cargar Google Maps:', error)}
    >
      <GoogleMap
        mapContainerStyle={mapStyles}
        zoom={15}
        center={defaultCenter}
      />
    </LoadScript>
  );
};

export default Map;
